import React from 'react';
import Noticia from './Noticia';

const Noticias = (props) => {

    return (
        <div className="row">
            <p>Hola desde noticias</p>
            {props.noticias.map( noticia =>{
                return(
                    <Noticia 
                    // key={noticia.url}
                    noticia={noticia}
                />
                )
            })}
        </div>
    );
};

export default Noticias;
